%% function reads in 12 months worth of data; each array has no index

function [ model_results ]=read_nc_vars_t(filename) 
filename=char(filename);
%filename = ('Model_1_MOD_pr.csv');
%% Read all the data
allData = csvread(filename);

%put all together in a large matrix called allData


%% Compute the empty line indices  -this is a script borrowed from MATHWORKS TM (lines 20-32)
fid = fopen(filename);
lines = textscan(fid, '%s', 'Delimiter', '\n');
fclose(fid);
blankLines = find(cellfun('isempty', lines{1}))';

%% Find the indices to separate data into cells from the whole matrix
iEnd = [blankLines - (1:length(blankLines)) size(allData,1)];
iStart = [1 (blankLines - (0:length(blankLines)-1))];
nRows = iEnd - iStart + 1;

%% Put the data into cells
Data = mat2cell(allData,nRows);
%do calculation here

%% Months have 28, 30, or 31 days
one=cell2mat(Data(1,:)); %January
one=one.*31/30;

two=cell2mat(Data(2,:)); %February
two=two.*28/30;

three=cell2mat(Data(3,:));%Marc
three=three.*31/30;

four=cell2mat(Data(4,:)); %April
four=four.*1;

five=cell2mat(Data(5,:));%May
five=five.*31/30;

six=cell2mat(Data(6,:));%June
six=six.*1.0;

seven=cell2mat(Data(7,:));%July
seven=seven.*31/30;

eight=cell2mat(Data(8,:));%August
eight=eight.*31/30;

nine=cell2mat(Data(9,:));%september
nine=nine.*1.0

ten=cell2mat(Data(10,:));%October
ten=ten.*31/30;

eleven=cell2mat(Data(11,:));%N0vember
eleven=eleven.*1;

twelve=cell2mat(Data(12,:));%December
twelve=twelve.*31/30;
%% concatenate each of the day-weighted months:
allData=[one;two;three;four;five;six;seven;eight;nine;ten;eleven;twelve];
Data = mat2cell(allData,nRows);
%%
A = Data(:,:);% matrix of all of the weighted months
avgyr = {mean(cat(3,A{:}),3)};%Take the average of al of the weighted months
avgyr=cell2mat(avgyr);
r=length(avgyr(1:end,:)+1);% finds the lenggth amd width of each matrix
c=length(avgyr(:,1:end)+1);
totyr=zeros(r,c);
